  wire        sourceValid = io_source_readDataAddr_valid | io_source_writeDataAddr_valid;
  wire [31:0] addr =
    io_source_readDataAddr_valid
      ? io_source_readDataAddr_bits
      : io_source_writeDataAddr_valid ? io_source_writeDataAddr_bits : 32'h0;
